DROP TABLE IF EXISTS `opf_business_pay`;
CREATE TABLE `opf_business_pay` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `business_id` int(11) DEFAULT NULL,
  `money` decimal(10,0) DEFAULT NULL,
  `store_time` varchar(255) DEFAULT '' COMMENT '开店时长',
  `pay_type` tinyint(1) DEFAULT '1' COMMENT '付款方式 1银联，2支付宝，3微信，4余额',
  `pay_time` int(11) DEFAULT '0' COMMENT '付款时间',
  `pay_status` tinyint(1) DEFAULT '0' COMMENT '0未付款，1已付款',
  `remark` text,
  `type` tinyint(1) DEFAULT '1' COMMENT '1保证金，2平台使用费',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8;

