-- Table structure for `opf_business_withdraw`
-- ----------------------------
DROP TABLE IF EXISTS `opf_business_withdraw`;
CREATE TABLE `opf_business_withdraw` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '提现id',
  `type` int(11) NOT NULL DEFAULT '0' COMMENT '提现方式:1:微信;2:支付宝;3:银行卡;',
  `account` varchar(64) NOT NULL DEFAULT '' COMMENT '提现账号',
  `account_name` varchar(64) NOT NULL DEFAULT '' COMMENT '账号名称',
  `amount` int(11) NOT NULL DEFAULT '0' COMMENT '【单位分】提现金额',
  `status` tinyint(3) NOT NULL DEFAULT '0' COMMENT '订单流程状态:0:待审核;5:审核通过转账中;10:提现成功;15:已拒绝;',
  `business_id` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',
  `mobile` varchar(32) NOT NULL DEFAULT '' COMMENT '用户手机',
  `name` varchar(32) NOT NULL DEFAULT '' COMMENT '商家名称',
  `reason` varchar(120) NOT NULL DEFAULT '' COMMENT '审核未通过原因',
  `operator_id` int(11) NOT NULL DEFAULT '0' COMMENT '操作员id',
  `created_at` int(10) NOT NULL DEFAULT '0' COMMENT '生成时间',
  `updated_at` int(10) NOT NULL DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `idx_type` (`type`),
  KEY `idx_business_id` (`business_id`),
  KEY `idx_status` (`status`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='商家提现表';

